This is an example of an implementation of a command // library code
trait CommandCallback<E: Into<JumiaError>> { async fn call(&self, client: &Client, interaction: &Interaction, args: &CommandArgs) -> Result<(), E>;
} impl<E, F> CommandCallback<E> for F
where E: Into<JumiaError>, F: Fn(&Client, &Interaction, &CommandArgs) -> Result<(), BotError>,
{ async fn call(&self, client: &Client, interaction: &Interaction, args: &CommandArgs) -> Result<(), E> { self(client, interaction, args) }
} // either library or user code
fn guild_only(callback: impl CommandCallback) -> impl CommandCallback { |client, interaction, args| async move { if interaction.guild_id.is_none() { interaction.reply(client, "Command must be run in guild").await?; } else { callback(client, interaction, args).await?; } }
} // user code
async fn echo_command(client: Client, interaction: Interaction, args: CommandArgs) -> Result<(), BotError> { interaction.reply(client, args.get_string("text")).await?; Ok(())
} fn example() { Client::builder() .commands(|commands| { commands .add(CommandBuilder::new() .name("echo") .option(OptionBuilder::new() .name("text") .kind(OptionKind::String)) .callback(guild_only(echo_command)) ) });
}
